tha e fìor gu ’ m bheil àireamh mòr de fhocalaibh iasaid anns a ’ Ghàidhlig . Cha ’ n ’ eil mi a ’ labhairt aig an àm mu na focail Bheurla leis am bheil a ’ Ghàidhlig air a measgachadh agus air a truailleadh anns na cearnaibh a tha criochadh ris a ’ Ghalldachd , ach mu na focalaibh a bhuineas do chainntibh eile a ta air faotainn àite anns a ’ chainnt , air chor a ’ s gu ’ m bheil iad a ’ deanamh suas cuibhrinn de ’ n chainnt a ta sinne a nise a ’ labhairt . Tha mòran de na focalaibh iasaid so air an toirt o ’ n Laidinn agus o ’ n Ghréigis troimh an Laidinn . Bha iomadh dhiubh , mar ta eaglais , sagart , creud , air an toirt a stigh do ’ n chainnt leis a ’ Chreidimh Chriosdaidh . A nis is fheudar na focail sin , agus mòran eile , mar ta scriobh o scribo ;
leugh o lego ;
creud o ’ n fhocal credo ;
aoradh ( ’ san t - sean Ghàidhlig adrad ) o adoratio ;
ceist o ’ n fhocal questio ;
